import './App.css';
import Header from './componnents/Header/Header';
import Nav from './componnents/Nav/Nav';
import Profile from './componnents/Profile/Profile';
import Dialogs from './componnents/Dialogs/Dialogs';
import { BrowserRouter, Routes, Route } from "react-router-dom"

function App() {
  let posts = [
    {id: 1, massage: 'Hi, how are you?', likeCount: 0},
    {id: 2, massage: 'It\'s my first post!', likeCount: 24},
  ]
  return (
    <BrowserRouter>
      <div className="app-wrapper">
        <Header />
        <Nav />
        <div className='app-wrapper-content'>
          <Routes>
            <Route path="/dialogs/*" element={<Dialogs />} />
            <Route path="/profile" element={<Profile />} />
          </Routes>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
